import React from 'react'
import Login from '../Login'
import './index.css'

const Home
  = () => {
    return (
      <div className='home-container'>
        <img src='https://res.cloudinary.com/ddruw0mnk/image/upload/v1741877811/13258d34acb4f447b53c9a567eacde69_emdjn6.png' alt='logo' className='logo-image' />
          <Login />
        </div>
    )
  }

export default Home
